    <div className="container">
          <section class="hero is-medium is-primary is-bold">
        <div class="hero-body">
          <div class="container">
            <h1 class="title">
              Project Manager
            </h1>
          </div>
        </div>
        </section>
    </div>
  );
}

export default App;
